import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

function createData(name, calories, fat, carbs, protein) {
return { name, calories, fat, carbs, protein };
}

const rows = [
createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
createData('Eclair', 262, 16.0, 24, 6.0),
createData('Cupcake', 305, 3.7, 67, 4.3),
createData('Gingerbread', 356, 16.0, 49, 3.9),
];

export default function EmployeeSchedule(props) {
return (
    <div>
    <ul>
    {props.schedule.mon.map(item => (
    	// <p>{item['09h'].duration}</p>
        <p>{Object.keys(item)[0]}</p>
    ))}
    </ul>
    {/* <h1>{props.schedule.mon[0]['11h00']['duration']}</h1> */}
    <TableContainer>
        <Table sx={{ minWidth: 650 }} size="small" aria-label="a dense table">
            <TableHead>
                <TableRow>
                    <TableCell align="center" colSpan={2}>Monday</TableCell>
                    <TableCell align="center" colSpan={2}>Tuesday</TableCell>
                    <TableCell align="center" colSpan={2}>Wednesday</TableCell>
                    <TableCell align="center" colSpan={2}>Thursday</TableCell>
                    <TableCell align="center" colSpan={2}>Friday</TableCell>
                </TableRow>
                <TableRow>
                    <TableCell align="right">Description</TableCell>
                    <TableCell align="right">Duration</TableCell>
                    <TableCell align="right">Description</TableCell>
                    <TableCell align="right">Duration</TableCell>
                    <TableCell align="right">Description</TableCell>
                    <TableCell align="right">Duration</TableCell>
                    <TableCell align="right">Description</TableCell>
                    <TableCell align="right">Duration</TableCell>
                    <TableCell align="right">Description</TableCell>
                    <TableCell align="right">Duration</TableCell>
                </TableRow>
            </TableHead>
            <TableBody>
                {rows.map((row) => (
                    <TableRow
                    key={row.name}
                    sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                    >
                    <TableCell component="th" scope="row">{row.name}</TableCell>
                    <TableCell align="right">{row.calories}</TableCell>
                    <TableCell align="right">{row.fat}</TableCell>
                    <TableCell align="right">{row.carbs}</TableCell>
                    <TableCell align="right">{row.protein}</TableCell>
                    </TableRow>
                ))}
            </TableBody>
        </Table>
    </TableContainer>
    </div>
);
}
